import styled from 'styled-components'

import Backdrop from '../../Backdrop'

const ChatContainer = styled.div`
    position: relative;
    padding: 0 24px;
`
const Cross = styled.img`
    position: fixed;
    top: 0;
    right: 0;
`

const Chat = () => {
    return (
        <Backdrop>
            <ChatContainer>
                <Cross src='/im' alt='cross-icon'  />
            </ChatContainer>
        </Backdrop>
    )
}

export default Chat
